import React, { useEffect } from 'react';
import './index'


// Components
import { NavBar } from './Components/Navbar/Navbar';

// Styles 

// Javascript
import M from 'materialize-css';


function App() {
  useEffect(() => {
    M.AutoInit();
  }, [] );
  //To Do: add props -->
  let handleClick = () => console.log('Hiciste click!.');
  return (
    <div className="App">
      <header>
        <NavBar
        click={handleClick}
        />
      </header>
    </div>
  )
}

export default App;
